import codon_table
seq=''
d = codon_table.codonTable()
counts = dict()

stop_count = 0
for i in d.values():
    if i == 'Stop':
        stop_count += 1
        continue
    counts[i] = counts.get(i, 0) + 1

# print(counts)
# print(stop_count)
answer = 1
for i in seq:
    answer *= counts[i]
print((answer*3)%10**6)
